                    <p>lorem ipsum dolor sit amet</p>
                    <p>
                        lorem dolor sit amet kitar ligot xersd adipiscing, neque
                    </p>
                </div>
            </div>
        </Faq>
    )
}

const Faq = styled(About)`
    display:block;
    span{
        display:block;
    }
    h2{
        padding-bottom: 2rem;
        font-weight:lighter;
    }
    .faq-line{
        background: #cccccc;
        height: 0.2rem;
        margin: 2rem 0rem;
        width: 100%;
    }
    .question{
        padding: 3rem 0rem;
        cursor:pointer;
    }
    .answer{
        padding: 2rem 0rem;
        p{
        padding:1rem 0rem;
        }
    }

`;

export default FaqSection;
